import React from "react";
import "./ImageBlockListing.css";
import ImageBlock from "../ImageBlock";

const ImageBlockListing = (props) => (
	<div className="container">
		<div className="row">
	    {props.imageNames.map((imageNames, index) => {
	      return <ImageBlock key={index} imageNames={imageNames} alt={imageNames} handleClick={props.handleClick} status={props.status} />
	    })}
	  </div>
  </div>
);

export default ImageBlockListing;
